import { BrowserRouter, NavLink, Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import './fonts.css'

function App() {
  return (
    <div style={{width:'auto', height:'auto', backgroundColor:'black'}}>

      <Layout/>

      <BrowserRouter>
        <Header />
        <Navigation />
        <Footer/>

      </BrowserRouter>


    </div>
  );
}

export default App;
